INSERT INTO `subscription` VALUES (1,'Start','Abonamentul START va permite accesul la unul din domeniile de mai jos.<br/> Va rugam sa bifati domeniul ales','Este recomandat firmelor mici cu pana la 9 angajati, care implica un numar de maxim 2 posturi, in special in domeniul serviciilor sau comertului. Permite rezolvarea integrala si generarea documentelor necesare in domeniul ales.',1,300.00,25,1,0,NULL),(2,'Office','Abonamentul OFFICE va permite accesul la 2 din domeniile de mai jos.<br/> Va rugam sa bifati domeniul ales','Este recomandat firmelor mici cu pana la 9 angajati, care implica un numar mai mare de 3 posturi, in domeniul serviciilor, comertului sau microproductiei. Permite rezolvarea integrala si generarea documentelor necesare in domeniile alese.',2,600.00,56,1,0,NULL),(3,'Enterprise','Abonamentul ENTERPRISE va permite accesul la 3 din domeniile de mai jos.<br/> Va rugam sa bifati domeniul ales','Este recomandat firmelor cu 10-49 angajati, care implica un numar mai mare de 3 posturi, in domeniul productiei, serviciilor si comertului. Permite rezolvarea integrala si generarea documentelor necesare in domeniile alese.',3,800.00,79,1,0,NULL),(4,'Business','Abonamentul BUSINESS va permite accesul la toate cele 5 domenii de mai jos.','Este recomandat firmelor mici cu pana la 9 angajati, care implica un numar mai mare de 3 posturi, in domeniul serviciilor, comertului sau microproductiei. Permite rezolvarea integrala si generarea documentelor necesare in domeniile alese.',5,1000.00,112,1,0,NULL),(5,'Expert','<p>Abonamentul EXPERT va permite accesul la domeniul SSM - E</p><p>Este recomandat pentru :</p><ul class=\"list-check forspacing\"><li><i class=\"fa fa-check\"></i> Firme acreditate ca si Serviciu Extern SSM</li><li><i class=\"fa fa-check\"></i> Firme cu peste 50 de angajati care au Serviciu Intern SSM</li><li><i class=\"fa fa-check\"></i> Firme cu pana la 50 de angajati care au Lucrator Desemnat SSM</li></ul><p>Pentru achizitia abonamentului, va rugam sa completati datele persoanei abilitata SSM</p><p>Acest modul va permite sa generati propriile Evaluari de risc si Planul de prevenire si protectie aferent; utilizand template-uri realizate de Dv. sau de alti abonati. In acest mod munca de rutina este preluata de soft, iar Dv. trebuie doar sa personalizati documentele cu elementele specifice Firmei pentru care intocmiti documentatia.</p>','Permite generarea de Evaluari de Risc pentru orice tip de post, indiferent de domeniul de activitate: productie, constructii, comert, servicii.',1,500.00,50,1,0,NULL);
/*!40000 ALTER TABLE `subscription` ENABLE KEYS */;
